DECLARE @DATA TABLE (DF_PRS_NME VARCHAR(9), [NAME] VARCHAR(100), CONFRIMATIONdATE VARCHAR(12), AWARDID VARCHAR(30), IC_LON_PGM VARCHAR(10), LD_DSB date, System_Rate varchar(10), file_rate varchar(10), Rate_Matches bit, Notes Varchar(100))

SELECT DISTINCT
	d.*,
	--LP06.PR_ITR_CLC_LP06 AS STAT_RATE,  -- statutory rate,
	LN72.LR_INT_RDC_PGM_ORG,
	CASE WHEN ACH.BF_SSN IS NOT NULL THEN 'Y' ELSE 'N' END AS ON_ACH
FROM
	@DATA D
	INNER JOIN CDW..FS10_DL_LON FS10
		ON (FS10.LF_FED_AWD + RIGHT('000' + CAST(FS10.LN_FED_AWD_SEQ AS VARCHAR(10)), 3)) = d.AWARDID
		AND FS10.BF_SSN = D.DF_PRS_NME
	INNER JOIN CDW..LN10_LON LN10
		ON LN10.BF_SSN = FS10.BF_SSN
		AND LN10.LN_SEQ = FS10.LN_SEQ
	INNER JOIN
			(	--Adding Active Interest Rate
				SELECT
					LN72.BF_SSN, 
					LN72.LN_SEQ,
					LN72.LR_INT_RDC_PGM_ORG,
					ROW_NUMBER() OVER (PARTITION BY LN72.BF_SSN, LN72.LN_SEQ, LN72.LD_ITR_EFF_BEG, LN72.LD_ITR_EFF_END ORDER BY LD_STA_LON72 DESC) AS SEQ
				FROM
					CDW..LN72_INT_RTE_HST LN72
					INNER JOIN CDW..PD10_PRS_NME PD10
						ON LN72.BF_SSN = PD10.DF_PRS_ID
				WHERE
					LN72.LC_STA_LON72 = 'A'
					AND	GETDATE() BETWEEN LN72.LD_ITR_EFF_BEG AND LN72.LD_ITR_EFF_END
					
			) LN72 
				ON LN10.BF_SSN = LN72.BF_SSN
				AND LN10.LN_SEQ = LN72.LN_SEQ
				AND LN72.SEQ = 1
			LEFT JOIN 
			(
				SELECT
					LN83.BF_SSN,
					LN83.LN_SEQ
				FROM
					CDW..BR30_BR_EFT BR30
					INNER JOIN CDW..LN83_EFT_TO_LON LN83
						ON BR30.BF_SSN = LN83.BF_SSN
						AND BR30.BN_EFT_SEQ = LN83.BN_EFT_SEQ
				WHERE
					BR30.BC_EFT_STA = 'A'
			) ACH
				ON ACH.BF_SSN = LN10.BF_SSN
				AND ACH.LN_SEQ = LN10.LN_SEQ
		